import React, { Fragment } from "react";
import Header from "./componensts/Layout/Header";
import Meals from "./componensts/Meals/Meals";
import Cart from "./componensts/Cart/Cart";
function App() {
  return (
    <Fragment>
      <Cart />
      <Header></Header>
      <main>
        <Meals />
      </main>
    </Fragment>
  );
}

export default App;
